description:
Exchange Student 3 [DvdRip].avi

Evan Stone, Julia Ann, Lily Labeau, Chad Alva, Angell Summers

What happens when a nice all-American family opens up their hearts and home to a shy and lonely exchange student from France? Will their happy family dynamic be shaken up or made stronger. Daughter Lily doesn't trust Parisian Angel with her boyfriend, and mom Julia doesn't trust her either with her husband. When desire replaces trust, the student gives the family a lesson of their own.

